  false,\n\t\"url\": null,\n\t\"notes\": \"Assessment of invertebrate resources in
  green tree reservoirs and seasonally-flooded crop fields at Noxubee National Wildlife
  Refuge. Mean winter invertebrate density and biomass in a greentree reservoir not
  flooded for 2 previous winters were either significantly greater than or similar
  to invertebrate resources in the naturally flooded forest at Noxubee National Wildlife
  Refuge. In contrast, invertebrate resources in a greentree reservoir, which was
  flooded each winter for 26 years, were significantly less than those inthe naturally
  flooded forest at Delta National Forest. During winter 1990-91 at Noxubee National
  Wildlife Refuge, mean invertebrate density in a moist-soil habitat was significantly
  less than that 1n the greentree reservoir; mean biomass was similar between habitats.
  Winter invertebrate resources in flooded grain-sorghum field were least among all
  habitats. Invertebrate resources in clearcut areas within the greentree reservoir
  were significantly less than those in uncut areas of the greentree reservoir. However,
  the magnitude of difference in invertebrate resources between clearcut areas and
  the greentree reservoir was again small (i.e., only 1.01-1.14 times different).\",\n\t\"owner_org\":
